INSERT INTO `sys_oper_log` VALUES (266, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250908_1_6242fdf7-19b2-405e-a986-06aae5fd9ecb_632x840.jpg_width256.webp\",\"backWeId\":\"10000341765\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:19\",\"delFlag\":\"0\",\"id\":1,\"name\":\"tan22\",\"params\":{},\"promot\":\"画面中，一位女子站在一处建筑的拱门下，身体靠墙。背景有拱形的石质门框，旁边摆放着一盆绿色的植物，地面是由石板铺成的台阶，整体场景营造出一种复古、优雅的氛围。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:17:17\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:17:17', 108);
INSERT INTO `sys_oper_log` VALUES (267, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250909_1_f0567e85-aec5-40d2-ab54-d083e69aa6e2_1080x1512.png_width256.webp\",\"backWeId\":\"10000343269\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:20\",\"delFlag\":\"0\",\"id\":7,\"name\":\"tan27\",\"params\":{},\"promot\":\"画面中，一位女子站在街边的红绿灯旁，双腿交叉站立，一只手自然下垂，另一只手放在身后。背景是灰色的墙壁，墙上爬满了开着粉色花朵的藤蔓植物，旁边有一个黑色的交通信号灯，地面是灰色的石板路，整体场景营造出一种都市与自然结合的氛围。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:18:03\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:18:03', 7);
INSERT INTO `sys_oper_log` VALUES (268, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250909_1_23b24b1f-5e64-4b27-aacf-40704de7cfa2_736x976.png_width256.webp\",\"backWeId\":\"10000343270\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:20\",\"delFlag\":\"0\",\"id\":6,\"name\":\"tan28\",\"params\":{},\"promot\":\"画面中，一位女子站在海边的岩石上，一只手抬起放在额头上。背景是广阔的蓝色大海和晴朗的天空，天空中飘着几朵白云，整体场景营造出一种清新、浪漫的氛围。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:18:55\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:18:55', 5);
INSERT INTO `sys_oper_log` VALUES (269, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250909_1_55d7b7cc-e105-4740-8a85-dbdbcc86d811_736x976.png_width256.webp\",\"backWeId\":\"10000343898\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:20\",\"delFlag\":\"0\",\"id\":8,\"name\":\"tan49\",\"params\":{},\"promot\":\"图中展现了一处海滨场景。人物坐在沙滩的蓝色毯子上，手里拿着墨镜，身旁有草编包、海星等物品。背景里，是广阔的海面，海浪轻轻拍打着沙滩，天空湛蓝，整体氛围清新自然，充满了海滨的闲适与美好。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:19:19\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:19:19', 6);
INSERT INTO `sys_oper_log` VALUES (270, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250909_1_c8f3df8d-2be8-4993-9ec1-3e0e5f3b396d_736x1304.png_width256.webp\",\"backWeId\":\"10000343903\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:19\",\"delFlag\":\"0\",\"id\":5,\"name\":\"tan54\",\"params\":{},\"promot\":\"一位女子戴着墨镜，坐在带有日文标识的船上。她双臂交叉，身旁放着一个浅色的包。背景是开阔的海面，海水呈现出澄澈的蓝色，远处是连绵的青山，天空湛蓝，飘着几朵白云，整体画面给人一种清新、惬意的感觉，仿佛正处于一段舒适的海上旅程中。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:19:46\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:19:46', 7);
INSERT INTO `sys_oper_log` VALUES (271, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250909_1_d3f6c449-ee04-4d99-9647-9e22bb3f4421_1080x1080.png_width256.webp\",\"backWeId\":\"10000343910\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:19\",\"delFlag\":\"0\",\"id\":4,\"name\":\"tan59\",\"params\":{},\"promot\":\"这是一幅充满夏日海滨风情的画面。画面中，一位女子站在沙滩上，她戴着白色墨镜，双手高举，一只手还提着一个草编包，姿态欢快。她身旁有一个木质路标，上面有蓝色和白色的指示牌，标注着 “LAS RANAS 59 Km”“PAPAYA PL 0.3 km” 等字样。远处是蔚蓝的大海，海浪轻轻拍打着沙滩，天空澄澈湛蓝，飘着几朵白云，整体氛围轻松惬意，尽显海滨度假的悠闲与美好。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:20:00\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:20:00', 5);
INSERT INTO `sys_oper_log` VALUES (272, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250909_1_2fa75298-c220-4c56-bb77-eee71e22586f_720x896.png_width256.webp\",\"backWeId\":\"10000344097\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:19\",\"delFlag\":\"0\",\"id\":3,\"name\":\"tan90\",\"params\":{},\"promot\":\"画面中，一位女子在海边的沙滩上侧身行走。背景是广阔的海面，海浪轻轻拍打着沙滩，远处的天空澄澈，沙滩上布满自然的脚印，右侧远处还有树木点缀，整体场景静谧悠然，充满海滨的悠闲惬意氛围。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:20:26\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:20:26', 8);
INSERT INTO `sys_oper_log` VALUES (273, '背景', 2, 'com.ruoyi.system.controller.WeBackController.edit()', 'PUT', 1, 'admin', NULL, '/back', '127.0.0.1', '', '{\"backUrl\":\"https://ai-image.weshop.com/20250909_1_b4e7a4fc-3d76-4593-9aca-c2ddb18e27b6_1024x1280.png_width256.webp\",\"backWeId\":\"10000344115\",\"createBy\":\"\",\"createTime\":\"2025-09-16 18:18:19\",\"delFlag\":\"0\",\"id\":2,\"name\":\"tan96\",\"params\":{},\"promot\":\"画面展现的是海边景致，天空呈淡蓝色，略带云层。海面波涛汹涌，白色的浪花不断翻涌、拍向岸边，其间还露出一些礁石。浅棕色的沙滩上，海浪涌来形成白色的泡沫，整体氛围清新又充满自然的动感，营造出惬意的海边氛围。\",\"type\":\"2\",\"updateBy\":\"\",\"updateTime\":\"2025-09-17 16:20:39\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-09-17 16:20:39', 7);
