INSERT INTO `we_back` VALUES (5, 'tan54', 'https://ai-image.weshop.com/20250909_1_c8f3df8d-2be8-4993-9ec1-3e0e5f3b396d_736x1304.png_width256.webp', '10000343903', '一位女子戴着墨镜，坐在带有日文标识的船上。她双臂交叉，身旁放着一个浅色的包。背景是开阔的海面，海水呈现出澄澈的蓝色，远处是连绵的青山，天空湛蓝，飘着几朵白云，整体画面给人一种清新、惬意的感觉，仿佛正处于一段舒适的海上旅程中。', '2', '0', '', '2025-09-16 18:18:19', '', '2025-09-17 16:19:47', NULL);
