INSERT INTO `we_back` VALUES (12, 'bsd47', 'https://ai-image.weshop.com/20250911_1_4c4ae953-bbb2-4a99-92e4-da58285b96cb_784x1000.png_width256.webp', '10000346062', '模特站立在雪地环境中，身体略微侧向画面左侧，头部微微转向镜头方向，目光直视前方，展现出一种沉稳而专注的神情。她的姿态挺拔，肩部自然放松，双臂自然下垂，右手握着滑雪板的一端，滑雪板斜跨于身前，从左下延伸至右上，形成一条动态的视觉引导线。双腿微微分开，站姿稳健，重心均匀分布，体现出一种准备行动却又保持静止的平衡感。整体姿态传达出自信、从容与户外运动的活力气息，与雪山背景融为一体，突显出一种冷峻而优雅的氛围。', '1', '0', '', '2025-09-16 18:18:20', '', '2025-09-17 13:20:21', NULL);
