INSERT INTO `we_back` VALUES (36, 'bsd14', 'https://ai-image.weshop.com/20250911_1_5c487bab-3b9d-4b28-8fab-8eb261ddcebd_824x536.png_width256.webp', '10000346017', '在这张图片中，模特站立在雪地山坡上，身体微微侧向镜头，呈现出一种自然且略带优雅的姿态。她的头部略微低垂，目光向下，似乎在凝视地面或沉思，给人一种安静、内敛的感觉。双臂自然下垂，轻轻搭在身侧，左手则微微抬起，手部动作显得放松而随意。整体姿态流畅而协调，展现出一种与雪山环境相融合的从容与自信。背景是开阔的雪景和远处连绵的山脉，增强了画面的空间感和宁静氛围。', '1', '0', '', '2025-09-16 18:18:20', '', '2025-09-17 13:20:21', NULL);
INSERT INTO `we_back` VALUES (37, 'bsd13', 'https://ai-image.weshop.com/20250911_1_ea6b5c44-ea9f-4d1d-8fd6-eb8f97104589_1080x1344.png_width256.webp', '10000346016', '这张图片中，两位模特站在一个开阔的白色平台上，背景是蓝天白云，整体氛围明亮而纯净。他们姿态自然、充满张力，展现出一种现代与极简风格的融合。左侧的模特身体略微前倾，双腿分开呈稳健的站姿，重心略向右偏，左腿微屈，右腿直立支撑，呈现出一种动态平衡感。双手插在大衣口袋中，头部微微侧转，目光投向画面右侧，仿佛在观察或等待什么，整体姿态显得沉稳而专注。右侧的模特则更为挺拔，身体正对镜头，双肩放松但保持挺直，右臂自然下垂，左手轻轻拉住外套的一角，似乎在调整衣摆，动作流畅而富有节奏感。双腿略微分开，膝盖微曲，重心分布均匀，表现出一种从容不迫的自信。她的视线朝向画面前方，神情坚定，带有一种探索或前行的意味。两人之间形成了一种微妙的互动关系：左侧模特的姿态更具内敛与思考感，而右侧模特则更显主动与开放。他们的站位和姿态共同营造出一种空间上的延伸感，仿佛正在走向未知的远方。背景中的斜线结构与云层的流动线条进一步增强了画面的层次与动感，使整个场景既静谧又充满力量。', '1', '0', '', '2025-09-16 18:18:20', '', '2025-09-17 13:20:21', NULL);
INSERT INTO `we_back` VALUES (38, 'bsd12', 'https://ai-image.weshop.com/20250911_1_8c5b0ebd-2d76-4adc-ad78-690c53e825bd_1200x1800.png_width256.webp', '10000346014', '这张图片中，两位模特站在雪地上，背景是蓝天白云和几条缆车索道。他们姿态自然且富有动感，展现出一种轻松而自信的氛围。左侧的模特身体略微前倾，左腿向前跨出一步，右腿微微弯曲支撑重心，呈现出一种准备起步或行走的姿态。他的双手抬起，一只手放在耳侧，似乎在调整护目镜或整理头部装备，动作流畅且充满生活感。整体姿势显得轻盈而有节奏，仿佛正享受着滑雪场上的自由时光。右侧的模特则站立得更为直立，身体略向一侧倾斜，右腿在前，左腿稍后，形成一种动态平衡。他的双臂自然垂放于身体两侧，右手插在大衣口袋中，左手轻轻搭在身侧，姿态从容而放松。头部微微侧转，目光朝向画面外，流露出一种专注又不失优雅的神情。两人之间的距离适中，彼此之间没有直接互动，但通过相似的站姿和方向感，营造出一种默契与协调的视觉效果。他们的姿态不仅展现了冬季户外活动中的活力与时尚感，也传递出一种对自然环境的融入与享受。整个画面因他们的姿态而充满动感与生命力。', '1', '0', '', '2025-09-16 18:18:20', '', '2025-09-17 13:20:21', NULL);
INSERT INTO `we_back` VALUES (39, 'bsd11', 'https://ai-image.weshop.com/20250911_1_bb77704c-cd10-47a2-8e03-f685ea96fb34_688x864.png_width256.webp', '10000346013', '模特正走在雪地与岩石交错的山坡上，身体微微前倾，展现出一种动态平衡的姿态。她的重心落在右腿上，左腿向后抬起，膝盖微屈，呈现出行走或轻跃的瞬间动作。双臂自然摆动，右手略微前伸，左手向后张开，增强了整体的运动感和协调性。头部略低，视线朝向地面，似乎在专注地观察脚下路况。整个姿态流露出一种轻松而自信的户外探索状态，仿佛正在享受雪山环境中的自由与活力。背景是晴朗的蓝天和积雪覆盖的山岩，衬托出她行动中的流畅线条与节奏感。', '1', '0', '', '2025-09-16 18:18:20', '', '2025-09-17 13:20:21', NULL);
